package ManishLokesh.Neptune.v1.GetOrderFromIRCTC.ResponseBody;public class IRCTCResponseBody {    private String orderId;    private String aggregatorOrderId;    private String status;    public IRCTCResponseBody(String orderId, String aggregatorOrderId, String status) {        this.orderId = orderId;        this.aggregatorOrderId = aggregatorOrderId;        this.status = status;    }    public String getOrderId() {        return orderId;    }    public void setOrderId(String orderId) {        this.orderId = orderId;    }    public String getAggregatorOrderId() {        return aggregatorOrderId;    }    public void setAggregatorOrderId(String aggregatorOrderId) {        this.aggregatorOrderId = aggregatorOrderId;    }    public String getStatus() {        return status;    }    public void setStatus(String status) {        this.status = status;    }}